import React from 'react'
import './Menu.scss'
import {
    NavLink
} from "react-router-dom";

function Menu() {
    return (
        <div className='Menu'>
            <ul class="list-group">
                <li class="list-group-item d-flex justify-content-between align-items-center">
                    <div>
                        <img src="https://img.icons8.com/color/20/000000/today.png" alt='img' />
                        Today
                    </div>                        <span class="badge badge-primary badge-pill">2</span>
                </li>
            </ul>
        </div>
    )
}

export default Menu
